import React from 'react';

const Error = () => {
  return (
    <>
    <div className="error-outer">
        <div className="error-inner">
            <div className="error-inner-child">
                <img src="assets/image/404.jpg" alt="img" />
            </div>
        </div>
    </div>
    </>
  );
};  

export default Error;
